script: |
  super -f text -I q9611.spq | sort > q9611.out

inputs:
  - name: q9611.spq
    data: |
      SELECT + 50 * - col0 FROM tab1 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN ( ( - 45 ) + 86 ) AND NULL OR NOT NULL IS NOT NULL;
  - name: tab1

outputs:
  - name: q9611.out
    data: |
      -2550
      -4250
      -4550
